import HeaderAndNavBar from './HeaderAndNavBar';
import FullAnalysis from "./FullAnalysis"
import {useLocation} from 'react-router-dom';
import {Link} from "react-router-dom";
import './Dreams.css';

function Dreams(props) {
    const dreamEntries = props.dreams.map((dr) => 
    <Link to="/FullAnalysis" state={{content: dr.dreamContent}}>
    <span className='entry'>
        <p id='title1'>{dr.dreamTitle} </p>
        <p id='desc1'>Genre: {dr.dreamGenre} </p>
        <p id='desc1'>{dr.dreamContent} </p>
    </span>
    </Link>
    );
  return (
    <div className='contents'>
    <HeaderAndNavBar />
    {dreamEntries}
    </div>
  );
}

export default Dreams;
